// import "./App.css";
import React, { useState, useEffect } from "react";

function App() {
  const [data, setData] = useState([{}]);
  const [message, setMessage] = useState({});
  useEffect(() => {
    fetch("/members")
      .then((res) => res.json())
      .then((data) => {
        setData(data);
        console.log(data);
      });
  }, []);

  useEffect(() => {
    fetch("/home")
      .then((res) => res.json())
      .then((value) => setMessage(value));
  }, []);

  const showData = () => {
    return;
    typeof data.members === "undefined" ? (
      <p>Loading...</p>
    ) : (
      data.members.map((member, i) => <p key={i}> {member}</p>)
    );
  };

  return (
    <div>
      {message.name}
      <button onClick={showData}>click here</button>
    </div>
  );
}

export default App;
